import './App.css';
import { Component } from 'react'

class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: [
       {
        name: 'm1'
      },
      {
        name: 'm2'
      },
      {
        name: 'm3'
      }
    ]
    }
  }

  render(){
    return (
      <div className="App">
        {this.state.monsters.map((monster) => {
            return <h1>{monster.name}</h1>
        })}
      </div>
    );
  }  
}

export default App;
